contracts/AML.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

contract AML{

    string[] bannedCountries = ["Iran","Afganistan","Turkmenistan","Kyrgyzstan"];

    function checkNationality(string memory userNationality) public returns(bool){



        //check if userNationality in bannedCountries
        for (uint i = 0; i < bannedCountries.length; i++) {
            if (keccak256(abi.encodePacked(bannedCountries[i])) == keccak256(abi.encodePacked(userNationality))) {
            return true;
            }
        }
        return false;
    }


    function checkPoliticalStatus(string memory isPoliticallyExposed) public returns(bool){


        //check if isPoliticallyExposed
        // if (keccak256(abi.encodePacked(bannedCountries[i])) == true:
        //     return true;

        return false;
    }



}

